import { Switch, Route } from "react-router-dom";
import Home from "./components/home/home";
import Login from "./components/forms/login";
import SignUp from "./components/forms/signup";
import HomeUsuario from "./components/usuarios/home";

const App = () => {
  return (
    <div>
      <Switch>
        <Route
          exact
          path="/"
          render={() => {
            return <Home></Home>;
          }}
        />
        <Route 
        exact path="/login" render={()=>{
          return <Login></Login>
        }}
        />
        <Route
        exact path="/signup" render={()=>{
          return <SignUp></SignUp>
        }}
        />
         <Route
        exact path="/home" render={()=>{
          return <HomeUsuario></HomeUsuario>
        }}
        />
 <Route
        exact path="/session" render={()=>{
          return <HomeUsuario></HomeUsuario>
        }}
        />
      </Switch>
    </div>
  );
};

export default App;
